// AddJournal.js
import React from 'react';
import HTMLFlipBook from 'react-pageflip';
import JournalPage from '../JournalPage/JournalPage';
import './AddJournal.css';

const AddJournal = (entries) => {
  const journalEntries = [
    { title: 'Day 1', content: 'Today I started journaling...' },
    { title: 'Day 2', content: 'It was a rainy day...' },
    { title: 'Day 3', content: 'Learned something new!' },
    { title: 'Day 4', content: 'Learned something new!' }
  ];

  return (
    <div className="book-container">
        <div className='page-background'></div>
      <HTMLFlipBook width={400} height={600} className="flipbook">
        {journalEntries.map((entry, index) => (
          <div key={index} className="page">
            <JournalPage title={entry.title} content={entry.content} />
          </div>
        ))}
      </HTMLFlipBook>
    </div>
  );
};

export default AddJournal;
